import React from 'react'
import './SearchBar.css'

export const SearchBar = ({ data }) => {
    return (
        <div>
            <div className="search-box">
                <input type='text' placeholder="Search for player" onChange={console.log(this.value)}/>
            </div>
            <div className="search-result">
                {data.map((value, key) => {
                    return <a className="player-data" href="">
                        <p>{value.Name}</p>
                    </a>
                })}
            </div>

        </div>
    )
}
